import { Link } from "react-router-dom";
import './index.scss';

const Home = () => {


    return (
        <div className="container home-page">
            <div className="text-zone">
                <h1>Hello, <br /> I'm Fox,
                <br />
                Software Developer.
                </h1>
                <h2>Full Stack | Web Development | Applications </h2>
                <Link to="/contact" className='flat-button'>CONTACT ME</Link>
            </div>

        </div>
    );
}

export default Home
